import React from 'react';
import '../../App.css';
import Mailto from 'react-mailto';


export default function ContactUs() {
  return (<>
  <h1 className='contact-us'>CONTACTO EDS</h1>
  <Mailto email="electronicdynamicsystems@gmail.com" obfuscate={true}>
        Enviar EMAIL!
      </Mailto>
  </>
  );
}
